import React from "react";

export default function SectionTag(props) {
  switch (props.sectionName) {
    case "world":
      return (
        <button type="button" style={{ background: "blueviolet" }}>
          {props.sectionName}
        </button>
      );
      break;
    default:
      return (
        <button type="button" class="btn btn-primary">
          {props.sectionName}
        </button>
      );
      break;
  }
}
